import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class CoinDataService {
  selectedCoin: any;

  constructor() {}

  setSelectedCoin(coin: any) {
    this.selectedCoin = coin;
  }

  getSelectedCoin() {
    return this.selectedCoin;
  }
}
